  true,\n\t\"url\": null,\n\t\"notes\": \"This data product contains TOMS/Nimbus-7
  Total Column Ozone Daily and Monthly Zonal Means Version 8 data in ASCII format.
  nnThe Total Ozone Mapping Spectrometer (TOMS) Version 8 Daily and Monthly Gridded
  Data consist of daily and monthly, global coverage of total column ozone, aerosol
  index, Lambertian effective reflectivity(Rayleigh corrected) and surface UV-B Erythemal
  irradiances. nnFour TOMS instruments have been successfully flown on the following
  satellites: Nimbus-7 (Nov. 1978 - May 1993), Meteor-3 (Aug. 1991 - Dec. 1994), Earth
  Probe (July 1996 - current), and ADEOS (Sep. 1996 - June 1997).nnEarth Probe, Meteor-3
  and Nimbus-7 data are currently reprocessed using the Version-8 algorithm ( http://ozoneaq.gsfc.nasa.gov/documents.md
  ) . These Version-8 data are archived at NASA Goddard Earth Sciences Data and Information
  Services Center (GES DISC).nnThe total ozone, aerosol index, reflectivity data and
  UV-B Erythemal irradiances are mapped to a global grid of size 180 x 288 with a
  Lat/Lon resolution of 1.00 x 1.25 degrees. These data are also stored in the EOS
  Version of Hierarchical Data Format (HDF-EOS). HDF was developed by the National
  Center for Supercomputer Applications (NCSA) at the University of Illinois at Urbana-Champaign.nnThe
  GES DISC maintains an online Web-based system (Giovanni) for previewing the data,
  subsetting in ASCII format, and downloading the data and images. The URL for Giovanni
  is http://giovanni.gsfc.nasa.gov/.nnThe Level-2 data at instrument resolution(approx
  50km x 50km pixel at nadir, in HDF5 EOS format) are also available from the GES
  DISC. nnFor more information regarding TOMS or other DAAC data sets please visit
  the GES DISC Home Page at http://disc.sci.gsfc.nasa.gov/acdisc/ , or contact the
  DISC Help Desk at: nnGES DISC Help DesknNASA Goddard Space Flight CenternCode 610.2nGreenbelt,
  MD 20771nngsfc-help-disc@lists.nasa.govnnTOMS data are produced by the Laboratory
  for Atmospheres at NASA Goddard Space Flight Center (Code 613). The Version-8 Algorithm
  Theoretical Basis Document (ATBD) is available from the TOMS site http://ozoneaq.gsfc.nasa.gov/documents.mdnnFor
  detailed information about the TOMS instrument, data, and ozone see the TOMS official
  Home Page at: http://ozoneaq.gsfc.nasa.gov/.n\",\n\t\"license_title\": \"U.S. Government
